script: |
  super -f text -I q1965.spq | sort > q1965.out

inputs:
  - name: q1965.spq
    data: |
      SELECT DISTINCT + col1 + ( - col1 + col2 ) FROM tab2 (FORMAT parquet) WHERE - - col1 * + - 65 * col1 + - 37 NOT IN ( + + col0 );
  - name: tab2

outputs:
  - name: q1965.out
    data: |
      23
      40
      58
